import React from 'react';
import { BrowserRouter as Router, Route, Redirect, Switch, Link } from 'react-router-dom';
import logo from './logo.svg';
import './App.css';
import Ss7 from './game/ss7/Ss7';
import Jackpot from './game/jackpot/Jackpot';
import Footer from './shared/components/Footer';



const App = () => {

  const handleClick = e => {
    {/* send to the specific game */}
    //alert(e);
  }

  return (

    <Router>
      <Switch>
        <Route path="/game/ss7" exact>
          <div className="App">
            <header className="App-header">
              <div className="skore" ><span className="logo_skore" id="sk">sk</span><img src={logo} className="App-logo" alt="logo" /><span className="logo_skore" id="re">re</span></div>
            </header>
          </div>
          <Ss7 />
          <Footer />
        </Route>
        <Route path="/game/jackpot" exact>
          <div className="App">
            <header className="App-header">
              <div className="skore"><span className="logo_skore" id="sk">sk</span><img src={logo} className="App-logo" alt="logo" /><span className="logo_skore" id="re">re</span></div>
            </header>
          </div>
          <Jackpot />
          <Footer />
        </Route>

        <Route path="/" exact>
          <div className="App">
            <header className="App-header">
              <div className="skore">
                <span className="logo_skore" id="sk">sk</span>
                  <img src={logo} className="App-logo" alt="logo" />
                <span className="logo_skore" id="re">re</span>
              </div>   
              <code id="llm_original">Long Live Mark</code>
            </header>
            <div className="game_container">
              <h2 className='skore_title'> Select the game for today</h2>
              <ul className="players_list">
                <Link to='/game/ss7'><li onClick={() => handleClick("super suka baby")}>secret suka 7</li></Link>
                <Link to='/game/jackpot'><li onClick={() => handleClick("jackpot")}>jackpot</li></Link>
                <Link to='/game/so-lo'><li>so lo</li></Link>
                {/* solo needs end button inf going on and save option to save game with player(s) */}
                {/* li click redirect to the /game/route idk how yet */}
              </ul>
            </div>
            <Footer />
          </div>
        </Route>

        <Redirect to='/' />
      </Switch>

    </Router>

  );
}

export default App;
